import React, { Component } from 'react';
import Developer from './components/developer';
import './App.css';

const developer = [
  {
    'id': 1,
    'image': 'https://placeimg.com/64/64/any',
    'name': '하늘',
    'birthday': '920927',
    'gender': '남자',
    'job': '대학원생'
  },
  {
    'id': 2,
    'image': 'https://placeimg.com/64/64/2',
    'name': '나동빈',
    'birthday': '960508',
    'gender': '남자',
    'job': '프로그래머'
  },
  {
    'id': 3,
    'image': 'https://placeimg.com/64/64/3',
    'name': '이순신',
    'birthday': '961127',
    'gender': '남자',
    'job': '디자이너'
  }
]

class App extends Component {
  render() {
    return (
      <Developer
        id={developer[0].id}
        image={developer[0].image}
        name={developer[0].name}
        birthday={developer[0].birthday}
        gender={developer[0].gender}
        job={developer[0].job}
      />
    );
  }
}


export default App;
